//import Treadmill from '../components/Treadmill'
import { connectToDatabase } from '../util/mongodb'
import Link from 'next/link'
import { signIn, signOut, useSession, getSession } from 'next-auth/client'

/* pass in data from user and define the display structure of Treadmill*/
function Treadmill({ treadmill, session }) {
  return (
    <div>
        <button className={treadmill.status===1 ? "treadmillFree" : "treadmillOccupied"}
          onClick={() => fetch("https://gymTracker.zihaodong.repl.co/api/writeToDatabase", {
            method: 'POST', 
            headers: {
              'Content-Type': 'application/json',
            },
            body: JSON.stringify({
              name: treadmill.name,
              _id: treadmill._id,
              likedBy: treadmill.Liked_By,
              action: treadmill.status === 1 ? "occupy" : "like",
              password: "n/a",
              nickname: session.user.name,
              }),
            })}>
          <Link href="/"> <a> {treadmill.name} </a> </Link>
        </button>
        <li className="treadInfo">Status: {treadmill.status===1?"free":"occupied"}</li>
        <li className="treadInfo">Powered Up By {treadmill.Liked_By} Users</li>
        <br />
      <style jsx>{`
        .treadmillFree {
          background: #99ccff;
          width: 100px;
          height: 60px;
          margin-top: 5px;
          margin-left: 5px;
          margin-right: 5px;
        }
        .treadmillFree:hover {
          background: #3399ff;
        }
        .treadmillOccupied {
          background: #ffff99;
          width: 100px;
          height: 60px;
          margin-top: 5px;
          margin-left: 5px;
          margin-right: 5px;
        }
        .treadmillOccupied:hover {
          background: #ffff00;
        }
        .treadInfo {
          margin-left: 20px;
          color: #0000ff;
        }
      `}</style>
    </div>
  )
}

/* Styling and formating the page */ 
export default function equipments({ data }) {
  console.log(data)
  const [ session, loading ] = useSession()
  //console.log(session?"session":"not session")
  return (
    session ? 
    // <button onClick={() => (window.alert("occupy treadmill"))}>
    //   "Treadmill 1"
    (
    <div>
      <h1>
        <div className="UCLA">UCLA</div>
        <div className="Title"> Treadmills At JWC</div>
        <button className="loginButton" onClick={signOut}>
          sign out
        </button>
      </h1>
      <div> logged in as {session.user.name} </div>
      <div>
        {data.map((treadmill) => (
          <Treadmill key={treadmill._id} treadmill={treadmill} session= {session}/>
       ))}
      </div>
      <style jsx>{`
        h1 {
          background: #3399ff;
          color: #ffffff;
        }
        .Title {
          padding-left: 5px;
        }
        .loginButton {
          background: #ffff00;
          position: absolute;
          top: 25px;
          right: 25px;
          width: 80px;
          height: 35px;
        }
        .loginButton:hover {
          background: #3399ff;
        }
        Link {
          color: #000000;
        }
        .JWC {
          position: absolute;
          top: 120px;
          right: 20px;
          height: 800px;
          width: 500px;
        }
        .UCLA {
          font-style: italic;
          color: #ffff00;
        }
      `}</style>
    </div>
    ) : (
      <div>
          <h1>
            <div className="UCLA">UCLA</div>
            <div className="Title"> Treadmills At JWC</div>
          </h1>
          <p>You are not permitted to see this page. Please Sign in or Sign up...</p>
          <button onClick={signIn}>Sign in</button>
          <button className = "signUp">
            <Link href="./signUp/signup">
              Sign up
            </Link>
          </button>
          <style jsx>{`
            .signUp {
              margin-left: 10px;
            }
            h1 {
              background: #3399ff;
              color: #ffffff;
            }
            .Title {
              padding-left: 5px;
            }
            .UCLA {
              font-style: italic;
              color: #ffff00;
            }
          `}</style>
      </div>
    )
  )
}

/* Get data from mongodb Database so that it can be displayed */
export async function getServerSideProps(context){
  const { db } = await connectToDatabase()
  const data = await db
    .collection("Treadmills")
    .find()
    .sort({name: 1})
    .toArray()

  // const data = collection.json()
  console.log(data)
  // console.log(data)
  return {
    props: {
      data: JSON.parse(JSON.stringify(data)),
      session: await getSession(context)
    }
  }
}

